import React from "react";

const ThemeRow = ({ theme }) => {
  return (
    <tr>
      <td className="py-3 pr-4 whitespace-nowrap">
        <div className="flex flex-wrap items-center">
          <span className="font-semibold">{theme.name}</span>
        </div>
      </td>
      <td className="py-3 pr-4">
        <span className="font-medium">{theme.registrants}人</span>
      </td>
      <td className="py-3 pr-4">
        <span className="font-medium">編集</span>
      </td>
      <td className="flex justify-end py-3 pr-4">
        <span className="px-2.5 py-1 text-sm font-medium bg-opacity-10 rounded-full text-red-900 bg-red-900">
          削除
        </span>
      </td>
    </tr>
  );
};

export default ThemeRow;
